  args: {
    children: [<Footer.Spotlight key="footer-spotlight">
        <Heading className="ams-visually-hidden" color="inverse" level={1}>
          Colofon
        </Heading>
        <Grid gapVertical="large" paddingVertical="medium">
          <Grid.Cell span={4}>
            <Heading className="ams-mb--xs" color="inverse" level={2} size="level-4">
              Meer weten
            </Heading>
            <LinkList>
              {['Veel gestelde vragen', 'Over ons', 'Werken bij', 'Kalender', 'Uit in Amsterdam', 'Bronnen'].map((label, index) => <LinkList.Link color="inverse" href="#" key={index} size="small">
                    {label}
                  </LinkList.Link>)}
            </LinkList>
          </Grid.Cell>
          <Grid.Cell span={4} start={{
          narrow: 1,
          medium: 5,
          wide: 5
        }}>
            <Heading className="ams-mb--xs" color="inverse" level={2} size="level-4">
              Contact
            </Heading>
            <Paragraph className="ams-mb--xs" color="inverse" size="small">
              Hebt u een vraag en kunt u het antwoord niet vinden op deze website? Neem dan contact met ons op.
            </Paragraph>
            <LinkList>
              <LinkList.Link color="inverse" href="mailto:redactie@amsterdam.nl" icon={EmailIcon} size="small">
                E-mail
              </LinkList.Link>
              <LinkList.Link color="inverse" href="tel:+3114020" icon={PhoneIcon} size="small">
                14 020
              </LinkList.Link>
              <LinkList.Link color="inverse" href="#" icon={ClockIcon} size="small">
                Contactgegevens en openingstijden
              </LinkList.Link>
            </LinkList>
          </Grid.Cell>
          <Grid.Cell span={4} start={{
          narrow: 1,
          medium: 1,
          wide: 9
        }}>
            <section className="ams-mb--md">
              <Heading className="ams-mb--xs" color="inverse" level={2} size="level-4">
                Nieuwsbrief
              </Heading>
              <LinkList>
                <LinkList.Link color="inverse" href="#" size="small">
                  Inschrijven
                </LinkList.Link>
              </LinkList>
            </section>
            <section>
              <Heading className="ams-mb--xs" color="inverse" level={2} size="level-4">
                Volg ons
              </Heading>
              <LinkList>
                {socialPlatforms.map(({
                icon,
                name
              }) => <LinkList.Link color="inverse" href="#" icon={icon} key={name} size="small">
                    {name}
                  </LinkList.Link>)}
              </LinkList>
            </section>
          </Grid.Cell>
        </Grid>
      </Footer.Spotlight>, <Heading className="ams-visually-hidden" level={2}>
        Over deze website
      </Heading>, <Footer.Menu>
        <Footer.MenuLink href="#">Over deze site</Footer.MenuLink>
        <Footer.MenuLink href="#">Privacy</Footer.MenuLink>
        <Footer.MenuLink href="#">Cookies</Footer.MenuLink>
      </Footer.Menu>]
  }
